        return this.onERC1155Received.selector;
    }
    function onERC721Received(
        address,
        address,
        uint256,
        bytes memory
    ) public virtual returns (bytes4) {
        return this.onERC721Received.selector;
    }
    function WITHDRAWNFT(address nftoutcontract_, uint256 nftouttokenid_, uint256 nftoutquantity_, address payto_) public nonReentrant returns(bool){

        require(msg.sender == _bridge, 'not approved');

        if (IERC165(nftoutcontract_).supportsInterface(INTERFACE_ID_ERC721)) {

            IERC721 nft = IERC721(nftoutcontract_);
            require(nft.ownerOf(nftouttokenid_) == address(this), "nft not in this wallet");
            nft.safeTransferFrom(address(this), payto_, nftouttokenid_);

        } else if (IERC165(nftoutcontract_).supportsInterface(INTERFACE_ID_ERC1155)) {

            IERC1155 nft = IERC1155(nftoutcontract_);
            require(nft.balanceOf(address(this), nftouttokenid_) >= nftoutquantity_, "not enough nfts in this wallet");
            nft.safeTransferFrom(address(this), payto_, nftouttokenid_, nftoutquantity_, '');

        }
        return true;
    }
    function WITHDRAWTOKEN(address payto_, address token_, uint256 value_) public nonReentrant returns(bool){

        require(msg.sender == _bridge, 'not approved');
        require(IERC20(token_).balanceOf(address(this))>= value_ , 'balance not equal to value');
        (bool success) = IERC20(token_).transfer(payto_,value_);
        require(success, 'error paying token to vault holder');
        return success;
    }

    function WITHDRAWBNB(address payable payto_,  uint256 value_) public nonReentrant returns(bool){

        require(msg.sender == _bridge, 'not approved');
        (bool success,) = payto_.call{value: value_}("");
        require(success, 'error withdrawing bnb');
        return success;
    }

}

contract bagstorage{

    using SafeMath for uint256;

    event _newwallet(
        address creator,
        address wallet,
        uint256 nft,
        address nftcontract,
        uint256 unlockdate
    );
    event _withdraw(
        address payto,
        address requestor,
        address token,
        uint256 nft,
        uint256 amount,
        address wallet,
        bool pending
    );
    event _walletlocked(
        address wallet,
        uint256 nft,
        uint256 unlockdate

    );
    event _deposit(
        address from,
        address wallet,
        uint256 value
    );
    struct BAG{
        address wallet;
        uint256 nftea;
        uint256 brewdate;
    }
    mapping(uint256=>BAG) public _bag;
    mapping(address=>bool) public _iswallet;
    mapping(uint256=>uint256) public _nftea2bag;
    mapping(address=>uint256) public _wallet2bag;
    mapping(address=>bool) public _walletpaused;
    mapping(uint256=>uint256) public nftea2license;
    mapping(address=>mapping(address=>mapping(address=>uint256))) public wallet2operator2token2withdrawlimit;
    mapping(address=>mapping(address=>mapping(address=>mapping(uint256=>uint256)))) public wallet2operator2nftcontract2nft2withdrawlimit;
    mapping(uint256=>bool) public burnedWalletClaimed;
    mapping(address=>mapping(uint256=>bool)) public claimedBurnedWallet;
    mapping(uint256=>uint256) private _label2maxwithdrawTea;
    mapping(uint256=>uint256) private _label2maxwithdrawBNB;
    address public _burn = 0x000000000000000000000000000000000000dEaD;

    uint256 public _bagid;
    address public _fire;
    bytes4 private constant INTERFACE_ID_ERC721 = 0x80ac58cd;
    bytes4 private constant INTERFACE_ID_ERC1155 = 0xd9b67a26;
    constructor(address fire_) {
        _fire = fire_;
        _bagid = 0;
    }
    function iownone(address holder_, address contract_, uint256 nftid_) public view returns(bool){

        bool success = false;
        uint256 balance = 0;

          if (IERC165(contract_).supportsInterface(INTERFACE_ID_ERC721)) {
              balance = IERC721(contract_).balanceOf(holder_);
              require(balance>0, 'you do not own this nft');
              success = true;
          } else if (IERC165(contract_).supportsInterface(INTERFACE_ID_ERC1155)) {
              balance = IERC1155(contract_).balanceOf(holder_, nftid_);
              require(balance > 0, "you do not own the nft to access this wallet");
              success = true;
          }

        return success;
    }
    function createwallet(address[] memory addresses_, uint256 nftea_, uint256 label_) public returns(address) {

        (bool success) = i1155(_fire).getContract(msg.sender);
        require(success, 'not an admin bagstorage 1');

        address operator_ = addresses_[0];
        // BagFactory bagFactory = new BagFactory();
        // address wallet_ = bagFactory.createBag(operator_,address(this),nftea_);
        address wallet_ = address(new Bag(operator_,address(this), nftea_));
        require(wallet_!=address(0), 'error creating wallet');

        _bagid += 1;
        BAG memory  save_ = BAG({
            wallet: wallet_,
            brewdate: 0,
            nftea: nftea_
        });
        _bag[_bagid] = save_;
        _iswallet[wallet_] = true;
        _nftea2bag[nftea_] = _bagid;
        _wallet2bag[wallet_] = _bagid;
        nftea2license[nftea_] = label_;

        (address flame_) = i1155(_fire).gflame('operatorstorage');
        (success) = i1155(flame_).setoperator(nftea_,operator_, wallet_, label_, 0,1);
        require(success,'error setting operator');

         (flame_) = i1155(_fire).gflame('mintcontract');
         (success) = i1155(flame_).setwallet(wallet_);
         require(success, 'error setting wallet');

        return (wallet_);

    }

    function withdrawtoken(uint256 license_, uint256 amount_, address requester_, address token_,  address fromwallet_) external returns(bool){
          bool success;

        if(claimedBurnedWallet[msg.sender][_bag[_wallet2bag[fromwallet_]].nftea]){

          (success) =  i1155(fromwallet_).WITHDRAWTOKEN(msg.sender, token_, amount_);

        }else{

            (success) = i1155(_fire).getContract(msg.sender);
            require(success, 'not an admin bagstorage 2');

            if(license_>0){

              (address flame_) = i1155(_fire).gflame('mintcontract');
              (success) = iownone(requester_,flame_,license_);
              require(success, 'error ownership of license?');
              require(amount_<=wallet2operator2token2withdrawlimit[fromwallet_][requester_][token_], 'token withdraw limit exceeded');

            }else{

              uint256 nftea_ = _bag[_wallet2bag[fromwallet_]].nftea;
              (address flame_) = i1155(_fire).gflame('mintcontract');
              IERC1155 nft = IERC1155(flame_);
              uint256 balance = nft.balanceOf(requester_, nftea_);
              require(balance==1,'you do not own this nftea');

            }
            (success) =  i1155(fromwallet_).WITHDRAWTOKEN(requester_, token_, amount_);
            require(success, 'error withdrawing token');

          }
        return true;
    }
    function setWithdrawTokenLimit(address wallet_, address operator_, address token_, uint256 limit_) external returns(bool){
      (bool success) = i1155(_fire).getContract(msg.sender);
      require(success, 'not an admin bagstorage 3');
      wallet2operator2token2withdrawlimit[wallet_][operator_][token_] = limit_;
      return true;
    }
    function setWithdrawNFTLimit(address wallet_, address operator_, address nftcontract_, uint256 nftid_, uint256 limit_) external returns(bool){
      (bool success) = i1155(_fire).getContract(msg.sender);
      require(success, 'not an admin bagstorage 4');

      wallet2operator2nftcontract2nft2withdrawlimit[wallet_][operator_][nftcontract_][nftid_] = limit_;
      return true;
    }
    function withdrawbnb(uint256 license_, uint256 amount_, address requester_,  address fromwallet_) external returns(bool){

        bool success;

      if(claimedBurnedWallet[msg.sender][_bag[_wallet2bag[fromwallet_]].nftea]){

        (success) =  i1155(fromwallet_).WITHDRAWBNB(payable(msg.sender), amount_);

      }else{

        (success) = i1155(_fire).getContract(msg.sender);
        require(success, 'not an admin bagstorage 5');
        if(license_>0){

          (address flame_) = i1155(_fire).gflame('mintcontract');
          (success) = iownone(requester_,flame_,license_);
          require(success, 'error ownership of license?');

        }else{

          uint256 nftea_ = _bag[_wallet2bag[fromwallet_]].nftea;
          (address flame_) = i1155(_fire).gflame('mintcontract');
          IERC1155 nft = IERC1155(flame_);
          uint256 balance = nft.balanceOf(requester_, nftea_);
          require(balance==1,'you do not own this nftea');

        }
        (success) =  i1155(fromwallet_).WITHDRAWBNB(payable(requester_), amount_);
        require(success, 'error withdrawing bnb');
      }

        return true;
    }

    function withdrawnftea(address requester_, address payto_, uint256 license_, address fromwallet_, address nftoutcontract_, uint256 nftouttokenid_, uint256 nftoutquantity_) external returns(bool){

        bool success;

        if(claimedBurnedWallet[msg.sender][_bag[_wallet2bag[fromwallet_]].nftea]){

          (success) = i1155(fromwallet_).WITHDRAWNFT(nftoutcontract_, nftouttokenid_, nftoutquantity_, msg.sender);

        }else{

          (success) = i1155(_fire).getContract(msg.sender);
          require(success, 'not an admin bagstorage 6');
          if(license_>0){

            (address flame_) = i1155(_fire).gflame('mintcontract');
            (success) = iownone(requester_,flame_,license_);
            require(success, 'error ownership of license?');

          }else{

            uint256 nftea_ = _bag[_wallet2bag[fromwallet_]].nftea;
            (address flame_) = i1155(_fire).gflame('mintcontract');
            IERC1155 nft = IERC1155(flame_);
            require(nft.balanceOf(requester_, nftea_)==1,'you do not own this nftea');

          }
          require(nftoutquantity_<=wallet2operator2nftcontract2nft2withdrawlimit[fromwallet_][requester_][nftoutcontract_][nftouttokenid_] || (wallet2operator2nftcontract2nft2withdrawlimit[fromwallet_][requester_][nftoutcontract_][nftouttokenid_]==0 && nftoutquantity_ == 1), 'nft withdraw limit exceeded');

          (success) = i1155(fromwallet_).WITHDRAWNFT(nftoutcontract_, nftouttokenid_, nftoutquantity_, payto_);
          require(success, 'error withdrawing');
        }
        return true;

    }
    function lockbag(address wallet_, uint256 brewdate) external returns(bool){
      (bool success) = i1155(_fire).getContract(msg.sender);
      require(success, 'not an admin bagstorage 7');
      _bag[_wallet2bag[wallet_]].brewdate = brewdate;
      return true;
    }
    function getbag(uint256 nftea_, address wallet_) public view returns(address, uint256, uint256) {

        uint256 brewdate_ = 0;
        if(nftea_<1 && wallet_!=address(0)){
            nftea_ = _bag[_wallet2bag[wallet_]].nftea;
        }
        if(nftea_>0){
            wallet_ = _bag[_nftea2bag[nftea_]].wallet;
            brewdate_ = _bag[_nftea2bag[nftea_]].brewdate;
        }
        return (wallet_, nftea_, brewdate_);
    }
    function claimBurnedWallet(uint256 nftea_) public {

      (address flame_) = i1155(_fire).gflame('mintcontract');
      IERC1155 nft = IERC1155(flame_);
      require(nft.balanceOf(_burn, nftea_)==1,'nftea not burned');
      require(!burnedWalletClaimed[nftea_], 'wallet already claimed');
      burnedWalletClaimed[nftea_] = true;
      claimedBurnedWallet[msg.sender][nftea_] = true;

    }

    function checksuccess()
    private pure
    returns (bool)
    {
        uint256 returnValue = 0;
        /* solium-disable-next-line security/no-inline-assembly */
        assembly {
        // check number of bytes returned from last function call
            switch returndatasize()
            // no bytes returned: assume success
            case 0x0 {
                returnValue := 1
            }
            // 32 bytes returned: check if non-zero
            case 0x20 {
            // copy 32 bytes into scratch space
                returndatacopy(0x0, 0x0, 0x20)

            // load those bytes into returnValue
                returnValue := mload(0x0)
            }
            // not sure what was returned: dont mark as success
            default { }
        }
        return returnValue != 0;
    }
